import React from 'react';
import './App.css';

const App = () => {
    return (
        <div className="app-wrapper">
            <header className="header">
                <img src="https://zavod-mix.ru/wp-content/uploads/2017/02/logo-header-dark-retina.png"/>
            </header>
            <nav className='nav'>
                <div>Profile</div>
                <div>Messages</div>
            </nav>
        </div>

    );
}

export default App;
